/**
 * A structure describing some interesting facts about an OS template license item
 */
export interface DedicatedTemplateOsInfoLicenseItemOVH {
  /**
   * OS template license item names
   * @nullable
   */
  name?: DedicatedTemplateOsInfoLicenseItemEnumOVH[] | null;
  /**
   * OS template license item url
   * @nullable
   */
  url?: string | null;
}

/**
 * OS template license usage details
 * @nullable
 */
export type DedicatedTemplateOsInfoLicenseOVHUsage = DedicatedTemplateOsInfoLicenseItemOVH | null;

/**
 * OS template license OS details
 * @nullable
 */
export type DedicatedTemplateOsInfoLicenseOVHOs = DedicatedTemplateOsInfoLicenseItemOVH | null;

/**
 * A structure describing some interesting facts about an OS template licensing
 */
export interface DedicatedTemplateOsInfoLicenseOVH {
  /**
   * OS template license OS details
   * @nullable
   */
  os?: DedicatedTemplateOsInfoLicenseOVHOs;
  /**
   * OS template license usage details
   * @nullable
   */
  usage?: DedicatedTemplateOsInfoLicenseOVHUsage;
}

/**
 * OS template project details
 * @nullable
 */
export type DedicatedTemplateOsInfoOVHProject = DedicatedTemplateOsInfoProjectOVH | null;

/**
 * OS template license details
 * @nullable
 */
export type DedicatedTemplateOsInfoOVHLicense = DedicatedTemplateOsInfoLicenseOVH | null;

/**
 * A structure describing some interesting facts about an OS template
 */
export interface DedicatedTemplateOsInfoOVH {
  /** OS Category (also called OS usage) */
  category?: DedicatedTemplateOsUsageEnumOVH;
  /** OS long name */
  description?: string;
  /**
   * OS template end of install at OVH date
   * @nullable
   */
  endOfInstall?: string | null;
  /** OS family (also called OS type) */
  family?: DedicatedTemplateOsTypeEnumOVH;
  /**
   * OS template license details
   * @nullable
   */
  license?: DedicatedTemplateOsInfoOVHLicense;
  /**
   * OS template project details
   * @nullable
   */
  project?: DedicatedTemplateOsInfoOVHProject;
  /** OS subfamily */
  subfamily?: DedicatedTemplateOsSubfamilyEnumOVH;
  /** OS template name */
  templateName?: string;
}

